	VivoRegionalization.prototype.load = function (){

		var self = this;

		self._loadByCookie(function(error){
			self._log("failed by cookie: " + error);

			self._loadByGeoip(function(error){
				self._log("failed by geoip: " + error);

				self._loadByGeolocation(function(error){

					self._onError(error);
					self._loadByUser();
				});
			});

		})

		return this;

	}

	VivoRegionalization.prototype.done = function(callback) {
		this._doneCallback = callback;
		return this;
	};

	VivoRegionalization.prototype.fail = function(callback) {
		this._failCallback = callback;
		return this;
	};

	VivoRegionalization.prototype._loadByCookie = function(onError) {

		this._log("_loadByCookie");

		if (!this.params.cookies)
			return onError(this.ERROR_COOKIE_FALSE);

		this.cookie = new Cookie();
		var cookieStr = this.cookie.get(this.COOKIE_NAME);
		this._log("this.cookie", this.cookie)
		if (cookieStr !== null && cookieStr !== ''){
			var cookieObj = JSON.parse(unescape(cookieStr));

			// checando se a região armazenada no cookie ainda é valida.
			// se não for, ignoramos e deixaremos ser sobrescrito no final

			// TODO: além da região, é necessário checar se o UF e/ou DDD está(ão) regionalizado(s)
			if (this._validateRegions(cookieObj.regions)){
				this.location = cookieObj.location;
				this.currentRegions = cookieObj.regions;
				this._onSuccess();
			}
			else {
				onError(this.ERROR_COOKIE_INVALID);
			}
		}
		else {
			onError(this.ERROR_COOKIE_EMPTY);
		}
	}

	// valida se uma lista de regioes estão registradas na gatewayData
	VivoRegionalization.prototype._validateRegions = function (regions){
		for (var i = 0; i < regions.length; i++){
			var region = regions[i];

			var found = false;
			for (var j = 0; j < this.params.regions.length; j++){
				var regionObj = this.params.regions[j];
				if (region == regionObj.name){
					found = true;
				}
			}

			if (!found)
				return false;
		}

		return true;
	}

	VivoRegionalization.prototype._loadByGeoip = function (onError){
		this._log("_loadByGeoip");

		if (!this.params.geoip)
			return onError(this.ERROR_GEOIP_FALSE);

		if (this.useMaxMindGeoIP)
			this._loadByGeoipMaxMind(onError)
		else
			this._loadByGeoipLocal(onError)

	}

