var diacriticsMap = {};
for (var i=0; i < defaultDiacriticsRemovalMap .length; i++){
    var letters = defaultDiacriticsRemovalMap [i].letters;
    for (var j=0; j < letters.length ; j++){
        diacriticsMap[letters[j]] = defaultDiacriticsRemovalMap [i].base;
    }
}

function removeDiacritics (str) {
    return str.replace(/[^\u0000-\u007E]/g, function(a){ 
       return diacriticsMap[a] || a; 
    });
}    

var _formatRegexp = function (q) {
	q = q.replace(/[é]/gi, 'e');
	q = q.replace(/[è]/gi, 'e');
	q = q.replace(/[ê]/gi, 'e');
	q = q.replace(/[ë]/gi, 'e');
	q = q.replace(/[à]/gi, 'a');
	q = q.replace(/[á]/gi, 'a');
	q = q.replace(/[ã]/gi, 'a');
	q = q.replace(/[â]/gi, 'a');
	q = q.replace(/[ç]/gi, 'c');
	q = q.replace(/[í]/gi, 'i');
	q = q.replace(/[ì]/gi, 'i');
	q = q.replace(/[ó]/gi, 'o');
	q = q.replace(/[ò]/gi, 'o');
	q = q.replace(/[ô]/gi, 'o');
	q = q.replace(/[ú]/gi, 'u');
	q = q.replace(/[ù]/gi, 'u');
	q = q.replace(/[ü]/gi, 'u');
	q = q.replace(/[û]/gi, 'u');
	return q;
};